DROP TABLE IF EXISTS `fac_solicitud`;
CREATE TABLE `fac_solicitud`  (
  `id` int(4) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT 'id del usuario que solicita',
  `nombre` varchar(150) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL COMMENT 'nombre del solicitante',
  `correo` varchar(150) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'correo del solicitante para notificaciones',
  `telefono` varchar(13) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'telefono del solicitante para notificacion',
  `rfc` varchar(13) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'RFC del solicitante requerido',
  `usocfdi` int(3) UNSIGNED ZEROFILL NOT NULL DEFAULT 003 COMMENT 'codigo del uso de cfdi',
  `condicion` varchar(15) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'condición de pago texto',
  `metodo` int(2) UNSIGNED NOT NULL DEFAULT 1 COMMENT 'metodo de pago viene de un catalogo',
  `forma` int(3) UNSIGNED ZEROFILL NOT NULL COMMENT 'forma de pago viene de un catalogo',
  `concepto` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL COMMENT 'descripción de la solicitud texto enriquecido',
  `comentario` tinytext CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL COMMENT 'pequeña descripción de la solicitud',
  `adjunto` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'archivo adjunto de la solicitud',
  `atendido` tinyint(1) NULL DEFAULT 0 COMMENT 'solicitud atendida ',
  `fecha` datetime(0) NULL DEFAULT NULL COMMENT 'timestamp de la solicitud',
  `created_at` timestamp(0) NULL DEFAULT NULL,
  `updated_at` timestamp(0) NULL DEFAULT NULL,
  `deleted_at` timestamp(0) NULL DEFAULT NULL,
  `atendidopor` int(11) UNSIGNED NULL DEFAULT NULL COMMENT 'id del usuario/empleado que antendió la solicitud',
  `facturaid` int(4) UNSIGNED NULL DEFAULT NULL COMMENT 'id de factura con la que se atendió la solicitud',
  `pagoverifica` tinyint(1) NULL DEFAULT NULL COMMENT 'Confirmación del pago',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `rfc`(`rfc`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `atendidopor`(`atendidopor`) USING BTREE,
  INDEX `usocfdi`(`usocfdi`) USING BTREE,
  INDEX `metodo`(`metodo`) USING BTREE,
  INDEX `forma`(`forma`) USING BTREE,
  CONSTRAINT `fac_solicitud_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fac_solicitud_ibfk_2` FOREIGN KEY (`atendidopor`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fac_solicitud_ibfk_4` FOREIGN KEY (`metodo`) REFERENCES `pago_metodo` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fac_solicitud_ibfk_5` FOREIGN KEY (`forma`) REFERENCES `pago_forma` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fac_solicitud_ibfk_6` FOREIGN KEY (`usocfdi`) REFERENCES `usocfdi` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE = InnoDB AUTO_INCREMENT = 36 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

